import React from 'react';

class Filter extends React.Component {
    render() {
        return(
            <div>
            <section className="myBtnContainer">
            <h2 className="product-head">Take a look at some of our products! </h2>
            <button className="btn1 btnAll"> Show all</button>
            <button className="btn1 btnShoes"> Shoes</button> 
            <button className="btn btnAccessories"> Accessories</button>
            <button className="btn btnPrices-100">$0 - $100</button>
            <button className="btn btnPrices-200">$100 - $200</button>
            <button className="btn btnPrices-300">$200 - $300</button>

            </section>

            </div>
        )
    }
}

export default Filter;
